import { Box } from "@mui/material";
import MyButton from "./MyButton";

const Navigator = () =>{
    return (
        <Box
            sx={{
                display: 'flex',
                justifyContent: 'center', // Distribuye los botones con espacio entre ellos
                alignItems: 'center',             // Alinea los botones verticalmente en el centro
                padding: '32px 0px',
                width: '100%',
            }}
        >
            <Box sx={{
                display: 'flex',             // Hace que los elementos sean flexibles y estén en fila
                alignItems: 'center',        // Alinea los botones verticalmente en el centro
                border: '1px solid #e0e0e0', // Borde del contenedor (opcional)
                width: '356px',              // Define el ancho del contenedor
                }}>                    
                <MyButton text="Home" ColorFondo="#f6f6f6" CornerRadius={0} fontColor="#656565" flexNumber={1} hover="#e0e0e0"/>
                <MyButton text="Portfolio" ColorFondo="#f6f6f6" CornerRadius={0} fontColor="#656565" flexNumber={1} hover="#e0e0e0"/>
                <MyButton text="Contact" ColorFondo="#f6f6f6" CornerRadius={0} fontColor="#656565" flexNumber={1} hover="#e0e0e0"/>
                <MyButton text="Home" ColorFondo="#f6f6f6" CornerRadius={0} fontColor="#656565" flexNumber={1} hover="#e0e0e0"/>
            </Box>
        </Box>
    );
}

export default Navigator;
